export const styles = theme => ({
  "@global": {
    body: {
      margin: 0
    },
    "#__next": {
      // background: "yellow"
    }
  },
    containerfoot: {
      // background: "green",
      display: "flex",
      maxWidth: 1280,
      margin: "auto"
    },
    upperFooter: {
      borderBottom: `solid 1px #2f3033`,
      "& > $container": {
        height: 88,
        display: 'flex'
      }
    },
    beetwenFooter: {
      borderBottom: `solid 1px #2f3033`,
      "& > $container": {
        height: 206,
        display: "flex"
      }
    },
    lowerFooter: {
      borderBottom: `solid 1px #2f3033`,
      "& > $container": {
        height: 58,
        display: "flex"
        }
    },
    logo: {
      display: "flex",
      justifyContent: "center",
      alignItems: "center"
    },
    categories: {
      display: "flex",
      alignItems: "center",
      "& > div": {
        width: 100,
        display: "flex",
        justifyContent: "center",
        alignItems: "center"
      }
    },
    emptySpacing: {
      flexGrow: 1
    }
});
